# get size of all files in directory (does not include sub-directories)
def get_dirsize(folder):
    total_size = os.path.getsize(folder)
    for item in os.listdir(folder):
        itempath = os.path.join(folder, item)
        if os.path.isfile(itempath):
            total_size += os.path.getsize(itempath)
        elif os.path.isdir(itempath):
            total_size += getFolderSize(itempath)
    return total_size

# reset existing directories
os.system("rm -r ./jpg/ && rm -r ./heic/")
os.system("mkdir ./jpg/ && mkdir ./heic/")

for ind, image in enumerate(images):
	image_num = ind + 1

	# get jpg
	os.system("curl " + image + " -o ./jpg/" + str(image_num) + ".jpg")

	print("Got JPG of image #" + str(image_num))

	# convert jpg to HEIC
	os.system("magick convert ./jpg/" + str(image_num) + ".jpg ./heic/" + str(image_num) + ".heic")

	print("Got HEIC of image #" + str(image_num))

jpg_total_size = get_dirsize('./jpg/')
heic_total_size = get_dirsize('./heic/')

print("Size of all JPGs: " + str(jpg_total_size) + " bytes")
print("Size of all HEICs: " + str(heic_total_size) + " bytes")

print("Total size of all HEIC photos is ~" + str(math.floor(heic_total_size / jpg_total_size * 10000) / 100) + "% of total size of all JPG photos.")